I was feeling good after finishing my working sets of squats so I decided to keep the intensity limited by doing beltless paused back squats. I worked up to a good single with 225kg/495lb, this was a little slower than i’d have liked but it is 98% of my best belted pause squat and my bodyweight is around 84kg so i will take it. 

I’ve been addressing some weaknesses in my core, my upper back, as well as my hips which is why I almost always relied heavily on belts for heavy squats and pulls. Being able to hit a weight like this with such minimal 80%+ squats is a good sign for me. My programming has me doing the perfect accessories to move towards my goals and it is definitely showing. 

If you’re having any weaknesses that you need to address or even if you just want to have a solid program every week that is tailored to you, there is no better option than the JTS Weightlifting AI. While you’re there signing up, use my code “JTSJake” for 10% off of all AI programming as well as the most comfortable and stylish training shorts and shirts.

